    <style>
        /* Dynamic Number Search Styles */
        body { 
            font-family: Arial, sans-serif; 
            text-align: center; 
            background-color: #111; 
            color: #fff;

            font-size: 20px; 
            background: #222; 
            color: #0f0;

            font-weight: bold; 
            padding: 20px; 
            border: 3px solid #ff0; 
            display: flex; 
            justify-content: center;

            height: 20px; 
            margin: 20px auto; 
            background: #333; 
            color: #ff0;
            box-shadow: 0px 0px 10px #ff0;
            pointer-events: none;
        }
        /* HIDDEN ELEMENTS */
        .percentage-box,
        #result,
        #r {
            display: none !important;
        }
        
        /* User Panel Styles */
        .container {max-width: 800px; margin: 20px auto;}
        .card {
            background: rgba(0,0,0,0.7); 
            padding: 20px; 
            border-radius: 10px; 
            box-shadow: 0 0 10px rgba(0,255,0,0.3); 
            margin-bottom: 20px;
            border: 1px solid #0f0;
            color: #fff;
        }
        .key-display {
            font-family: monospace; 
            background: rgba(0,0,0,0.5); 
            padding: 15px; 
            border-radius: 5px; 
            margin: 15px 0;
            border: 1px solid #0f0;
            color: #0f0;
        }
        .timer {
            font-size: 24px; 
            text-align: center; 
            margin: 20px 0;
            color: #0f0;
        }
        .btn {

            background: #0f0; 
            color: #000; 
            border: none; 
            border-radius: 5px; 
            cursor: pointer;
            font-weight: bold;
        }
        .btn-danger {
            background: #f00;
            color: #fff;
        }
        h2 {
            color: #0f0;
        }

</head>

        // Number input validation and paste handling
        function setupInputHandlers() {
            for (let i = 1; i <= 4; i++) {
                const input = document.getElementById(`input${i}`);
                
                // Prevent non-numeric input
                input.addEventListener('input', function(e) {
                    this.value = this.value.replace(/[^0-9]/g, '');
                    processData();
                });
                
                // Handle paste event to clean non-numeric characters
                input.addEventListener('paste', function(e) {
                    e.preventDefault();
                    const text = (e.clipboardData || window.clipboardData).getData('text');
                    const numbersOnly = text.replace(/[^0-9]/g, '');
                    this.value = numbersOnly;
                    processData();
                });
            }
        }

        function processData() { 
            var groupedData = [];
            for (var i = 0; i <= dataset.length - 7; i++) {
                groupedData.push(dataset.slice(i, i + 7));
            }

            var searchValues = [];
            for (var i = 1; i <= 4; i++) {
                var val = document.getElementById("input" + i).value.trim();
                if (val) searchValues.push(parseInt(val));
            }
 
            if (searchValues.length !== 4) {
                document.getElementById("result-box").innerText = "";
                return;
            }

            var matchedNumbers = groupedData.filter(row => searchValues.every((v, i) => row[i] === v)).map(row => row[6]);

            if (matchedNumbers.length === 0) {
                document.getElementById("result-box").innerText = "";
                return;
            }

            var countB = matchedNumbers.filter(num => num >= 5 && num <= 9).length;
            var countS = matchedNumbers.filter(num => num >= 0 && num <= 4).length;

            document.getElementById("result-box").innerText = countB > countS ? "BIG" : countS > countB ? "SMALL" : "??";
        }

        // User Panel Script
        // Check login
        const accessKey = localStorage.getItem('accessKey');
        const expiresAt = localStorage.getItem('expiresAt');
        
        if (!accessKey || !expiresAt) {
            window.location.href = "user_login.html";
        }
        
        // Display key info
        document.getElementById('displayKey').textContent = accessKey;
        document.getElementById('displayExpiry').textContent = new Date(parseInt(expiresAt)).toLocaleString();
        
        // Countdown timer
        function updateCountdown() {
            const now = Date.now();
            const remaining = parseInt(expiresAt) - now;
            
            if (remaining <= 0) {
                document.getElementById('countdown').textContent = "EXPIRED";
                logout();
                return;
            }
            
            const days = Math.floor(remaining / (1000 * 60 * 60 * 24));
            const hours = Math.floor((remaining % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
            const mins = Math.floor((remaining % (1000 * 60 * 60)) / (1000 * 60));
            const secs = Math.floor((remaining % (1000 * 60)) / 1000);
            
            document.getElementById('countdown').textContent = 
                `${days}d ${hours}h ${mins}m ${secs}s`;
        }
        
        // Logout
        function logout() {
            localStorage.removeItem('userLoggedIn');
            localStorage.removeItem('accessKey');
            localStorage.removeItem('expiresAt');
            window.location.href = "user_login.html";
        }

        document.addEventListener('DOMContentLoaded', () => {
            // Setup input handlers for number fields
            setupInputHandlers();
            
            // Update countdown every second
            setInterval(updateCountdown, 1000);
            updateCountdown();
            
            // Disable all input events on result box
            const resultBox = document.getElementById("result-box");
            resultBox.addEventListener('click', (e) => {
                e.preventDefault();
                e.stopPropagation();
                return false;
            });
        });
    </script>
